import { GridList } from "@material-ui/core";
import { Item } from "../../components/cart-item/item.css"
import { Constants } from "../../Constants";
import React from 'react';
const UserProgress = () => {

    const orders = React.useState(Constants.getToLocalStorage(Constants.ORDER) === null ? [] : Constants.getToLocalStorage(Constants.ORDER))

    return (
        <div className="onprogress-container">
            <GridList cols={3} cellHeight={250} style={{ height: 'auto' }} >
                {
                    orders.map(order =>
                        <ul key={order.id}>
                            <Item key={order.id} productData={order} />
                        </ul>
                    )
                }
            </GridList>
        </div>
    );
}

export default UserProgress;
